    def is_valid(grammar, string):
        grammar_map = {}
        for tag in grammar.keys():
            grammar_map[tag] = 0

        for token in string:
            if token in grammar_map:
                grammar_map[token] += 1

        return grammar_map

    def generate_string(grammar, string):
        if not string:
            return ""

        if string in grammar_map:
            return string

        for tag in grammar:
            if tag in grammar_map:

                next_string = generate_string(grammar, string + tag)
                if next_string:
                  return next_string

        return ""

    if is_valid(s, s):
        generated_string = generate_string(s, s)
